How to use $geoNear after $lookup<p>Hi i have the following problem:
I would like to use $geoNear (to count distance between two points) but after $loopback (and on collection that i joined).
This is the model for companyBases collection (i would like to join it): </p>

<pre><code>{
    "_id" : ObjectId("5d7cfe13f42e7345d967b378"),
    "location" : {
        "type" : "Point",
        "coordinates" : [
            20.633856,
            49.761268
        ]
    },
    "vehicles" : [
        {
            "_id" : ObjectId("5d7cfe13f42e7345d967b340"),
            ...other fields that doesn't matter
        }
    ]
}
</code></pre>

<p>This is vehicle collection: </p>

<pre><code>{
            "_id" : ObjectId("5d7cfe13f42e7345d967b340"),
            ...other fields that doesn't matter
}
</code></pre>

<p>I would like to join companyBase collection in aggregation on vehicles collection:</p>

<pre><code>db.vehicles.aggregate([
  {
    $lookup: {
      from: "companybases",
      let: {
        vehicleId: "$_id"
      },
      pipeline: [
        {
          $match: {
            $expr: { $in: ["$$vehicleId", "$vehicles._id"] }
          }
        }
      ],
      as: "companyBases"
    }
  },
  {
    $unwind: "$companyBases"
  },
  {
    $geoNear: {
      near: {
        type: "Point",
        coordinates: [50.02485, 20.0008]
      },
      distanceField: "distance",
      spherical: true
    }
  }
]);


</code></pre>

<p>But it returns me:</p>

<pre><code>{
    "message" : "$geoNear is only valid as the first stage in a pipeline.",
    "operationTime" : "Timestamp(1568472833, 1)",
    "ok" : 0,
    "code" : 40602,
    "codeName" : "Location40602",
    "$clusterTime" : {
        "clusterTime" : "Timestamp(1568472833, 1)",
        "signature" : {
            "hash" : "AAAAAAAAAAAAAAAAAAAAAAAAAAA=",
            "keyId" : "0"
        }
    },
    "name" : "MongoError"
}
</code></pre>

<p>When i am doing the same pipeline on companybases collection it returns me documents with counted distance:</p>

<pre><code>db.companybases.aggregate([
  {
    $geoNear: {
      near: {
        type: "Point",
        coordinates: [50.02485, 20.0008]
      },
      distanceField: "distance",
      spherical: true
    }
  }
]);

</code></pre>

<p>And result:</p>

<pre><code>{
    "_id" : ObjectId("5d7cfe13f42e7345d967b378"),
    "location" : {
        "type" : "Point",
        "coordinates" : [
            20.633856,
            49.761268
        ]
    },
    "vehicles" : [
        {
            ...some fields
        },

    ],
    ...some fields
    "distance" : 4209673.447019393
}
</code></pre>

<p>I realize that the error may be because of missing index on vehicles collection. So is there any way to calculate distance with $geoNear with $lookup ? Or maybe it's impossible and i have to do on my own ?</p>

