How to verify embedded document before saving?<p>I've got a basic spring rest api system based on Spring and mongdb.
 two simple models which represent two collections  : User and Book </p>

<p>With one to many relationship: one user can have multiple books</p>

<p>I would like to verify on creating/updating a user , that the related books exist on books collection. What should be the best practice to do that? Is there a solution in spring for this?</p>

<p>I thought of getting books as an array of id's and validate them in the controller , and then if the validation is correct, get them from books collections and save them
and then i think , Users models should have array of ids, instead of books object
